import React from 'react'
import data from './data'

const Menu = () => {
  return (
    <div>
      {
          data.map((onedata,index)=>{
            const {name_folder,id} = onedata
            return<div key={id}>
              <p>{name_folder}</p>
              <button>{name_folder}</button>
            </div>
          })
        }
    </div>
  )
}

export default Menu
